ISLAMABAD, Jan 27 (APP): Chief of Jamiat Ulema-e-Islam (F) Maulana Fazal-ur-Rehman called on Prime Minister Muhammad Shehbaz Sharif here on Friday.
Overall political situation in the country was discussed during the meeting, which was also attended by Minister for Finance and Revenue Ishaq Dar and Advisors to PM Ahad Cheema and Engr. Amir Muqam.
